window.bookSummaryJSON = "<p><b>She chose him. He chose revenge. But some choices have deadly consequences.</b></p> <p>When Elise agreed to break a vicious curse over the man she loved, she never imagined he was a lost fae prince. But Valen left her to carry out vengeance for his slaughtered family. So when she joins the outlaw fae in their uprising against her own sister, all Elise wants is to forget the prince who holds her heart.</p> <p>But fate has a different plan.</p> <p>Reunited in the rescue of a mutual friend, Elise and Valen are forced to decide where they stand in the battle of crowns. As their passion reignites, so too do the dangers threatening to pull them apart for good: a strange magical blight infecting the land, betrayal by one of their own, and a devastating secret not even a fae prince saw coming.</p> <p>The wicked game for the right to rule has begun. But who will save Elise and Valen from a dark magic with the power to destroy their love forever?</p> <p>For fans of<i> The Cruel Prince</i> and <i>The Shadows Between Us</i>, this tale of a rebellious princess and a seductive prince is wickedly romantic.</p>"; 
